import React from "react";

function CoolStuff() {
  return (
    <div id="cool">
      <h3>Cool Stuff You Can Hear Me Talking About</h3>
      <p>1- FRC</p>
      <p>2- Chess</p>
      <p>3- Minecraft</p>
      <p>4- Drawing</p>
      <p>5- My Dog</p>
    </div>
  );
}

export default CoolStuff;
